      <div>
        <button onClick={handleClick}>Next</button>
      </div>
      return <Page1/>
    } else {
      <div>
        <button onClick={handleClick}>Back</button>
      </div>
      return <page2/>
    }
  }

  const handleClick = () => {
    setShowSquare(!showSquare);
  }
